import React from 'react';
import { ArrowRightIcon } from '@heroicons/react/24/outline';
import { motion } from 'framer-motion';
import { useScrollAnimation, slideInLeft, slideInRight, fadeInUp } from '../hooks/useScrollAnimation';

const Hero = () => {
  return (
    <section id="home" className="relative min-h-screen flex items-center justify-center bg-light-blue overflow-hidden">
      {/* Background Pattern */}
      <div className="absolute inset-0 bg-hero-pattern opacity-10"></div>

      {/* Content */}
      <div className="relative z-10 container-custom px-6">
        <div className="grid grid-cols-1 lg:grid-cols-2 gap-12 items-center">
          {/* Left Side - Image */}
          <motion.div 
            className="relative"
            variants={slideInLeft}
            initial="hidden"
            animate="visible"
          >
            <div className="relative z-10">
              <div className="w-full h-96 bg-gradient-to-br from-primary to-primary/80 rounded-3xl shadow-2xl">
                <div className="w-full h-full bg-light-blue rounded-3xl flex items-center justify-center">
                  <div className="text-center text-text-dark/60">
                    <div className="w-24 h-24 bg-primary/10 rounded-full flex items-center justify-center mx-auto mb-4">
                      <svg className="w-12 h-12 text-primary" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                        <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4.318 6.318a4.5 4.5 0 000 6.364L12 20.364l7.682-7.682a4.5 4.5 0 00-6.364-6.364L12 7.636l-1.318-1.318a4.5 4.5 0 00-6.364 0z" />
                      </svg>
                    </div>
                    <p className="text-lg font-medium">Modern Dental Clinic</p>
                    <p className="text-sm">Professional & Caring Environment</p>
                  </div>
                </div>
              </div>
            </div>

            {/* Decorative Elements */}
            <motion.div 
              className="absolute -top-4 -left-4 w-20 h-20 bg-primary/30 rounded-full opacity-20"
              animate={{ 
                scale: [1, 1.2, 1],
                opacity: [0.2, 0.4, 0.2]
              }}
              transition={{ 
                duration: 3, 
                repeat: Infinity,
                ease: "easeInOut"
              }}
            />
            <motion.div 
              className="absolute -bottom-4 -right-4 w-16 h-16 bg-primary/30 rounded-full opacity-20"
              animate={{ 
                scale: [1, 1.3, 1],
                opacity: [0.2, 0.5, 0.2]
              }}
              transition={{ 
                duration: 4, 
                repeat: Infinity,
                ease: "easeInOut",
                delay: 1
              }}
            />
          </motion.div>

          {/* Right Side - Content */}
          <motion.div 
            className="text-center lg:text-left"
            variants={slideInRight}
            initial="hidden"
            animate="visible"
          >
            <motion.div 
              className="text-primary text-sm font-medium mb-4"
              variants={fadeInUp}
            >
              + WELCOME TO DENTALCARE
            </motion.div>
            <motion.h1 
              className="font-heading font-bold text-4xl md:text-6xl lg:text-7xl mb-8 leading-tight tracking-wide text-text-dark"
              variants={fadeInUp}
            >
              Experience Best in
              <span className="text-primary block">Dental Care</span>
            </motion.h1>

            <motion.p 
              className="text-lg md:text-xl mb-10 text-text-light max-w-2xl mx-auto lg:mx-0 leading-relaxed"
              variants={fadeInUp}
            >
              It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal.
            </motion.p>

            <motion.div 
              className="flex flex-col sm:flex-row gap-6 justify-center lg:justify-start items-center"
              variants={fadeInUp}
            >
              <motion.button 
                className="btn-primary text-lg px-10 py-5 flex items-center gap-3"
                whileHover={{ scale: 1.05 }}
                whileTap={{ scale: 0.95 }}
              >
                Make An Appointment
                <ArrowRightIcon className="h-5 w-5" />
              </motion.button>
            </motion.div>

            {/* Rating */}
            <motion.div 
              className="mt-8 flex items-center justify-center lg:justify-start gap-2"
              variants={fadeInUp}
            >
              <span className="text-text-light">Google Rating 5.0</span>
              <div className="flex gap-1">
                {[...Array(5)].map((_, i) => (
                  <motion.svg 
                    key={i} 
                    className="w-4 h-4 text-yellow-400" 
                    fill="currentColor" 
                    viewBox="0 0 20 20"
                    initial={{ scale: 0 }}
                    animate={{ scale: 1 }}
                    transition={{ delay: i * 0.1 }}
                  >
                    <path d="M9.049 2.927c.3-.921 1.603-.921 1.902 0l1.07 3.292a1 1 0 00.95.69h3.462c.969 0 1.371 1.24.588 1.81l-2.8 2.034a1 1 0 00-.364 1.118l1.07 3.292c.3.921-.755 1.688-1.54 1.118l-2.8-2.034a1 1 0 00-1.175 0l-2.8 2.034c-.784.57-1.838-.197-1.539-1.118l1.07-3.292a1 1 0 00-.364-1.118L2.98 8.72c-.783-.57-.38-1.81.588-1.81h3.461a1 1 0 00.951-.69l1.07-3.292z" />
                  </motion.svg>
                ))}
              </div>
              <span className="text-text-light">Based On 492 Reviews</span>
            </motion.div>
          </motion.div>
        </div>
      </div>

      {/* Scroll Indicator */}
      <motion.div 
        className="absolute bottom-8 left-1/2 transform -translate-x-1/2"
        animate={{ y: [0, 10, 0] }}
        transition={{ 
          duration: 2, 
          repeat: Infinity,
          ease: "easeInOut"
        }}
      >
        <div className="w-6 h-10 border-2 border-text-dark rounded-full flex justify-center">
          <motion.div 
            className="w-1 h-3 bg-text-dark rounded-full mt-2"
            animate={{ opacity: [0.5, 1, 0.5] }}
            transition={{ 
              duration: 1.5, 
              repeat: Infinity,
              ease: "easeInOut"
            }}
          />
        </div>
      </motion.div>
    </section>
  );
};

export default Hero;
